import { SimpleGrid, GridItem, Box, } from "@chakra-ui/react";
import Card from './Card'



function GridGeneral() {

  return (

        <Box p={6}>
          <SimpleGrid bg={'rgba(51,47,83,1) 100%'} spacing="30px" minChildWidth="300px">
           <Card></Card>
           <Card></Card><Card></Card><Card></Card><Card></Card><Card></Card><Card></Card>
          </SimpleGrid>
        </Box>

  );
}

export default GridGeneral;
